import React, { useState, useEffect, useContext } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from 'axios';
import { UserContext } from '../Contexts/User';
import { 
    Container, 
    Typography, 
    Box, 
    Button, 
    List, 
    ListItem, 
    ListItemIcon, 
    ListItemText,
    Paper,
    CircularProgress
} from '@mui/material';
import CheckCircleIcon from '@mui/icons-material/CheckCircle';
import CancelIcon from '@mui/icons-material/Cancel';

const QuizSummary = () => {
    const { quizId } = useParams();
    const [summary, setSummary] = useState(null);
    const [loading, setLoading] = useState(true);
    const { user } = useContext(UserContext);
    const navigate = useNavigate();

    useEffect(() => {
        const fetchSummary = async () => {
            try {
                setLoading(true);
                const response = await axios.get(
                    `http://localhost:8080/users/${user.id}/quiz/${quizId}/results`
                );
                // Get the latest quiz attempt
                const latestSummary = response.data[response.data.length - 1];
                setSummary(latestSummary);
            } catch (error) {
                console.error('Error fetching quiz summary:', error);
                setLoading(false);
            }
        };

        if (user && quizId) {
            fetchSummary();
        }
    }, [quizId, user]);

    if (loading) {
        return (
            <Box display="flex" justifyContent="center" alignItems="center" minHeight="80vh">
                <CircularProgress />
            </Box>
        );
    }

    if (!summary) {
        return (
            <Container>
                <Typography variant="h6" color="error">
                    Failed to load quiz summary. Please try again.
                </Typography>
            </Container>
        );
    }

    const handleContinue = async () => {
        try {
            if (summary.passed) {
                if (summary.quizType === 'FINAL') {
                    navigate('/certificates');
                } else {
                    navigate(`/learn/${summary.courseId}/${summary.nextLessonId}`);
                }
            } else {
                navigate(`/courses/${summary.courseId}`);
            }
        } catch (error) {
            console.error('Error handling navigation:', error);
        }
    };

    return (
        <Container maxWidth="md">
            <Box mt={4} mb={4}>
                <Paper elevation={3} sx={{ p: 4 }}>
                    <Typography variant="h4" align="center" gutterBottom>
                        Quiz Results
                    </Typography>

                    <Box mt={4} textAlign="center">
                        <Typography variant="h1" 
                            color={summary.passed ? 'success.main' : 'error.main'}
                            sx={{ mb: 2 }}
                        >
                            {summary.score}%
                        </Typography>
                        <Typography variant="h5" 
                            color={summary.passed ? 'success.main' : 'error.main'}
                            sx={{ mb: 3 }}
                        >
                            {summary.passed ? 'Congratulations! You Passed!' : 'Please Try Again'}
                        </Typography>
                    </Box>

                    <List sx={{ mt: 4 }}>
                        {summary.questions.map((question, index) => (
                            <ListItem key={index} sx={{ mb: 2, bgcolor: 'background.paper', borderRadius: 1 }}>
                                <ListItemIcon>
                                    {question.correct ? 
                                        <CheckCircleIcon color="success" /> : 
                                        <CancelIcon color="error" />
                                    }
                                </ListItemIcon>
                                <ListItemText
                                    primary={question.text}
                                    secondary={
                                        <>
                                            <Typography component="span" color="textSecondary">
                                                Your answer: {question.userAnswer}
                                            </Typography>
                                            {!question.correct && (
                                                <Typography component="span" color="error" sx={{ display: 'block' }}>
                                                    Correct answer: {question.correctAnswer}
                                                </Typography>
                                            )}
                                        </>
                                    }
                                />
                            </ListItem>
                        ))}
                    </List>

                    <Box mt={4} textAlign="center">
                        <Button
                            variant="contained"
                            color="primary"
                            size="large"
                            onClick={handleContinue}
                        >
                            {summary.passed ? 
                                (summary.quizType === 'FINAL' ? 'View Certificate' : 'Continue to Next Lesson') : 
                                'Return to Course'}
                        </Button>
                    </Box>
                </Paper>
            </Box>
        </Container>
    );
};

export default QuizSummary;
